import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoadingPage from './comp/LoadingPage';
import NavBar from './comp/NavBar';
import GlobalMap from './comp/GlobalMap'; // Import the GlobalMap component
import './App.css';

const App = () => {
    return (
        <Router>
            <div className="App">
                <NavBar /> {/* NavBar stays across pages */}
                <Switch>
                    <Route path="/" exact component={LoadingPage} /> {/* Default route */}
                    <Route path="/map" component={GlobalMap} /> {/* Route to GlobalMap */}
                </Switch>
            </div>
        </Router>
    );
};

export default App;
